function Home() {
  return (
    <section className="home">
      <div className="home-content">
        <h1>Welcome to My Website</h1>
        <p>We offer various services to meet your needs.</p>
        <button className="btn">Learn More</button>
      </div>
    </section>
  );
}

export default Home;
